description:
Kuca za rusenje 1992 Domaci Film

Spomenka, devojcica zbrinuta kod hranitelja pokusava da ponovo okupi svoju razorenu prirodnu porodicu, sto nadilazi njene decje snage... Majka dolazi iz inostranstva posle dugo vremena, sto u Spomenki probudi nadu da ce ponovo biti svi zajedno, nesrecno udata starija sestra i mali brat koji zivi na selu kod rodjaka... Sa svojim drugom cesto obilazi sada praznu kucu u kojoj je provela neke lepe upamcene trenutke detinjstva, verujuci da ce uspeti da ozivi hladne zidove kuce odavno predvidjene za rusenje... Ali, majcini planovi sasvim su drugaciji od njenih... Sukob sa zivotnom realnoscu ucinice da glavna junakinja shvati da je sreca detinjstva neuhvatljiva...

Rezija: Zoran Tanaskovic

Uloge: Anita Mancic, Radmila Zivkovic, Dubravka Mijatovic

